import React from 'react';
import PropTypes from 'prop-types';

const CompanyCard = ({ company, onClickCompany }) => {
  return (
    <div
      className="company-card bg-white p-6 rounded-lg shadow-lg hover:shadow-xl transition-shadow cursor-pointer"
      onClick={() => onClickCompany(company._id)}
    >
      <h3 className="text-2xl font-semibold mb-2">{company.name}</h3>
      <p className="text-gray-700 mb-2">{company.location}</p>
      <p className="text-gray-700 mb-2">{company.emails.join(', ')}</p>
      <p className="text-gray-700 mb-2">{company.phoneNumbers.join(', ')}</p>
      <p className="text-gray-700 mb-2">{company.linkedinProfile}</p>
    </div>
  );
};

CompanyCard.propTypes = {
  company: PropTypes.shape({
    _id: PropTypes.string.isRequired,
    name: PropTypes.string.isRequired,
    location: PropTypes.string.isRequired,
    emails: PropTypes.arrayOf(PropTypes.string).isRequired,
    phoneNumbers: PropTypes.arrayOf(PropTypes.string).isRequired,
    linkedinProfile: PropTypes.string,
  }).isRequired,
  onClickCompany: PropTypes.func.isRequired,
};

export default CompanyCard;
